export const url = 'https://auth.nomoreparties.co';

export const register = (password, email) => {
  return fetch(`${url}/signup`, {
    method: 'POST',
    headers: {
      Accept: 'application/json',
      'Content-Type': 'application/json',
    },
    body: JSON.stringify({
        "password": password,
        "email": "email@email.ru"
    }),
  })
    .then((res) => {
      try {
        if (res.status === 200) {
          console.log(res);
          return res.json();
        }
      } catch (err) {
        return err;
      }
    })
    .then((res) => {
      return res;
    })
    .catch((err) => {
      console.log(err);
    });
};
